シャット 流せるトイレブラシ 替えブラシ 12個入り<br>ブランド：シャット<br>販売・製造元：ジョンソン<br><br>お掃除後、汚れたブラシ部分をさわらずにトイレにサッと流せる、便利なトイレブラシの替えブラシ(12個入り)です。<br>濃縮洗剤付きのデコボコブラシで、トイレの汚れをしっかり落とします。<br>水に濡れるとブラシについた濃縮洗剤が溶け出し、水の中もしっかりとこすれます。<br> <br><br><br>使用方法<br>1.点線に沿ってハサミでお切りください。<br>ブラシが取り出しやすくなります。<br>2.洗剤付きブラシを取り出します。<br>ブラシは12個入っています。<br>3.6個のブラシが1ブロックになっています。<br>ブラシを1個ずつ切り離して使います。<br>*ブラシは10枚のシートを重ねたものです。<br>ブラシが薄い(シート10枚より少ない)と、ハンドルにブラシがはさめなかったり、使用中に外れたりすることがあります。<br>4.洗剤付きブラシをハンドルに取り付けます。<br>ハンドルの青いつまみを先端方向へ押すと、ハンドル先端のヘッドの先が広がります。<br>ブラシを差しこみ、青いつまみを手元の方向へ引きます。<br>この時、ブラシをしっかり固定するためカチッと音がするまでつまみを引いてください。<br>5.使用後、青いつまみを先端方向へ押すと、ブラシが外れます。<br>便器に捨てて流すか、燃やせるゴミとして廃棄してください。<br> <br><br>使用上の注意<br>●用途以外には使用しない。<br>●子供の手の届くところに置かない。<br>●手あれの気になる方や長時間使用する場合は、ゴム製などの手袋を使う。<br>●金属面、プラスチック面、ガラス面、木部などには使わない。<br>●つまりを避けるため、ブラシは1個ずつ流す。<br>●流さないときは燃やせるゴミとして出す。<br>●洗剤付きブラシはこの箱と一緒に保管してください。<br> 品質表示ブラシ：セルロース、レーヨン材質：合成繊維成分：界面活性剤、除菌剤大きさ：50*50*16mm <br>日用品／家庭用品／トイレ用品／トイレ用スポンジ・ブラシ<br>JANコード： 4901609000292<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
